Szczerbaków is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Wi%C5%9Blica"&gt;Gmina Wiślica&lt;/a&gt;, within &lt;a href="Busko%20County"&gt;Busko County&lt;/a&gt;, &lt;a href="%C5%9Awi%C4%99tokrzyskie%20Voivodeship"&gt;Świętokrzyskie Voivodeship&lt;/a&gt;, in south-central Poland. It lies approximately east of &lt;a href="Wi%C5%9Blica"&gt;Wiślica&lt;/a&gt;, south of &lt;a href="Busko-Zdr%C3%B3j"&gt;Busko-Zdrój&lt;/a&gt;, and south of the regional capital &lt;a href="Kielce"&gt;Kielce&lt;/a&gt;.
